import React from 'react';
import './TopBar.scss';

class TopBar extends React.Component {
  render () {
    return (
      <div id="navigation-bar">
        <nav>
          <ul>
            <li><a href="#Home" onClick={() => this.props.handler(0)}>Home</a></li>
            <div className="dropdown">
              <button className="dropbtn">Projects&#9;<i className="arrow down"></i>
              </button>
              <div className="dropdown-content">
                <a href="#Projects" onClick={() => this.props.handler(1)}>The Court of the Crimson King</a>
                <a href="#Projects" onClick={() => this.props.handler(1)}>Canvas Dash</a>
                <a href="#Projects" onClick={() => this.props.handler(1)}>Leinecker's Leins</a>
              </div>
            </div>
            <li><a href="#Personal" onClick={() => this.props.handler(2)}>Personal</a></li>
          </ul>
        </nav>
      </div>
    )
  }
}

export default TopBar;
